import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
// components
import About from './About';
import Skills from './Skills';


let Main = () => {
  return (
    <main>
      <About />
      <Skills />

      {/* <!-- projects section --> */}
      <div className="row flex-column guitar-back min-vh-100" id="projects">
        <div className="section-title mx-auto d-flex section-margin justify-content-center flex-column text-center">          
          <h2 className="p-0 mb-0">Projects</h2> 
          <div className="underline"></div>
        </div>
        <div className="col-sm-9 col-md-7 col-lg-4 mx-auto my-5 vid-div card p-0">
          <video src="myJam.mov" controls autoPlay muted loop className="mx-auto card-img-top"></video>
          <div className="card-body card-back">
            <h5 className="card-title">myJam</h5>
            <p className="card-text">Fullstack Capstone project for PDX Code Guild.  Search for upcoming concerts by city using Axios for API requests to Ticketmaster, also allows local artists to add their own events.  HTML, CSS, Bootstrap, Django, Django REST framework, Vue.js, Axios.</p>
          </div>
        </div>
      {/* <!-- end projects section --> */}
      </div>
    </main>
  );
}

export default Main;
